import React from "react";
import Container from "react-bootstrap/Container";
import "../Navgation/nav.css";
import "boxicons";

const Navgation = () => {
  return (
    <nav>
      <Container>
        <div className="row">
          <div className="col-lg-8">
            <ul>
              <li>
                <box-icon name="search-alt-2" color='#fff'></box-icon>
              </li>
              <li>
                <box-icon type="logo" name="facebook-square" color='#fff'></box-icon>
              </li>
              <li>
                <box-icon name="twitter" type="logo" color='#fff'> </box-icon>
              </li>
              <li>
                <box-icon name="telegram" type="logo" color='#fff'></box-icon>
              </li>
            </ul>
          </div>
          .
        </div>
      </Container>
    </nav>
  );
};
export default Navgation;
